window.bookSummaryJSON = "<p>Old plan: Go to school, learn about my magic, fall in love with my guys, and maybe be normal for once in my life.</p> <p>New plan: Do all of those things. After I take care of the greedy, corrupt fae who are messing up the natural order of things.</p> <p>The gods have entrusted me to restore the balance between light and dark, whether I want to or not. If the fae want to keep their magic, they have to show that they deserve it.</p> <p>But do they? It's time for me to decide whether my people are worth fighting for.</p> <p>Contains mature themes.</p>"; 
